//import {BrowserRouter, Route, Switch} from 'react-router-dom'
import CSS from './components/css';
import Sidebar from './components/sidebar'

class App extends Component {
  render() {
    return (
      <div className="App">
        <Sidebar/>
        <CSS/>
      </div>
    );
  }
}

export default App;
